import React from 'react';
import { createUseStyles } from 'react-jss';

const useStyles  = createUseStyles({
    heading: {
        fontSize: 50,
    },
    highlight: {
        backgroundColor: 'orange',
    }
})

const Home = () => {
    const classes = useStyles()
    return ( 
        <div className="home">
            <h1 className={classes.heading}>
                Hi, I'm <span className={classes.highlight}>mimi</span>, and this is my recent activities on: <br />
                <span className={classes.highlight}>spotify</span>, 
                <span className={classes.highlight}>instagram</span>,
                <span className={classes.highlight}>tiktok</span>,
                <span className={classes.highlight}>linkedin</span>,
                <span className={classes.highlight}>youtube</span>,
                <span className={classes.highlight}>pinterest</span>,
                <span className={classes.highlight}>discord</span>
            </h1>
        </div>
     );
}

export default Home;
